class Solution:
    def increasingSequence(self, nums: str) -> str:
        def dfs(nums, index, curr, res, next_pos):
            if next_pos == len(nums):
                res.append(curr)
                return
            for i in range(index, len(nums)):
                if i == index:
                    nums[i] = -nums[i]
                else:
                    nums[i] = curr
                    next_pos += 1
                    dfs(nums, next_pos, curr + nums[i], res, next_pos)
                    nums[i] = -nums[i]
                    next_pos -= 1

        res = []
        dfs(nums, 0, 0, [], 0)
        return ",".join(map(str, res))

