class Solution:
    def __init__(self):
        self.memo = {0: -1}

    def helper(self, i: int, A: list) -> str:
        # 모든 공간보다 짝수 횟수
        if i in self.memo:
            return self.memo[i]

        # 모든 공간보다 큰 값이 더 높은 경우에만 저장
        if A[i] % 2 == 0:
            self.memo[i] = A[i]
            return self.helper(i, A)

        # 큰 값을 자리보다 짝수 길이가 큰 경우에만 갱신
        else:
            self.memo[i] = max(A[i], A[i]+self.helper(i-2, A))
            return self.memo[i]

    def maxSum(self, A: list) -> str:
        return self.helper(len(A)-1, A)

