class Solution:
    def detectCycle(self, head: ListNode) -> ListNode:
        slow = head
        fast = head
        while fast and fast.next:
            slow = slow.next
            fast = fast.next.next
            if slow == fast:
                break
        if fast is None or fast == slow:
            return None
        slow = slow.next
        while slow!= fast:
            slow = slow.next
            fast = fast.next
        return slow

