class Solution:
    def minimumDistance(self, p: str) -> str:
        rows = []
        columns = []
        for i in range(len(p)):
            rows.append(int(p[i]))
        for i in range(len(p)-1):
            columns.append(int(p[i]))
        minimum = float('inf')

        for i in range(len(rows)):
            for j in range(i+1, len(rows)):
                minimum = min(minimum, abs(rows[i]-rows[j]))

        for i in range(len(columns)):
            for j in range(i+1, len(columns)):
                minimum = min(minimum, abs(columns[i]-columns[j]))
        return str(minimum)

