def solution(stdin: str) -> str:
    N, M, t, S, U, D, L, R = map(int, stdin.strip().split())
    if N + M == t:
        return 0
    elif N * M == t:
        return N // M
    elif N * M > t:
        return 0
    elif N * M < t:
        return 0

    grid = [['0' for _ in range(N + 1)] for _ in range(N + 1)]
    for i in range(1, N + 1):
        grid[i][i] = '1'
    for i in range(1, N + 1):
        grid[i][i] = 'S'
    grid[1][1] = 'U'
    for i in range(2, N + 1):
        for j in range(1, N + 1):
            if grid[i][j]!= '1':
                continue
            if i == 1 and j == 1:
                continue
            if (i - 1 >= 0 and j - 1 >= 0 and grid[i - 1][j - 1] == 'S' and
                    grid[i][j - 1] == 'U' and grid[i - 1][j] == 'U'):
                grid[i][j] = 'R'
                grid[i - 1][j - 1] = 'R'
            elif (i - 1 >= 0 and j - 1 >= 0 and grid[i - 1][j - 1] == 'S' and
                    grid[i][j - 1] == 'U' and grid[i - 1][j] == 'D'):
                grid[i][j] = 'L'
                grid[i - 1][j - 1] = 'L'

    visited = [[False for _ in range(N + 1)] for _ in range(N + 1)]
    for i in range(1, N + 1):
        visited[i][i] = True
    queue = [[1, 1]]
    while queue:
        i, j = queue.pop(0)
        for k in range(4):
            ni = i + 1 if k == 0 else i - 1
            nj = j + 1 if k == 1 else j - 1
            if ni < 1 or ni > N or nj < 1 or nj > N or grid[ni][nj] == '0':
                continue
            if not visited[ni][nj] and grid[ni][nj] == '1':
                visited[ni][nj] = True
                queue.append([ni, nj])

    def escape(ni, nj):
        return grid[ni][nj] == 'S' or grid[ni][nj] == 'U'

    return len([ni for ni in range(1, N + 1) if escape(ni, ni)])

def solution(stdin: str) -> str:
    str = stdin.readline().strip().split(' ')
    n = int(str[0])
