    n = int(stdin.split()[0])
    distances = [int(i) for i in stdin.split()[1:]]

    # if the first element is larger than the next, it is the minimum distance.
    for n, dist in enumerate(distances, start=1):
        # if it is bigger than the first, it is the next distance.
        if dist > distances[n - 1]:
            distances[n] = distances[n - 1]
    # if the next element is smaller than the previous, it is the distance of the current car to the next element.
    # this is because we are adding all distances and we have to ensure that we are not approaching the previous element.
    for i in range(1, n):
        if distances[i] > distances[i - 1]:
            distances[i] = distances[i - 1]

    return str(min(distances))

